FILE *iFile,
	 *oFile;
int stateStack[STACKAMOUNT][STACKSIZE],
	*currentStack,
	*alternateStack,
	acceptState,
	acceptLength,
	stackIndex,
	returnLength,
	inStack[STACKSIZE],
	isEOF = 0;

void escape(char *tmp, char c) {
	if (c == '\t') {
		tmp[0] = '\\';
		tmp[1] = 't';
		tmp[2] = 0;
	} else if (c == '\n') {
		tmp[0] = '\\';
		tmp[1] = 'n';
		tmp[2] = 0;
	} else {
		tmp[0] = c;
		tmp[1] = 0;
	}
}
void inClear() {
	int size = stateIndex;
	for ( ; size--; ) {
		inStack[size] = 0;
	}
}
void swapStacks() {
	int *temp = currentStack;
	currentStack = alternateStack;
	alternateStack = temp;
}
void pushStack(int state) {
	alternateStack[stackIndex++] = state;
	inStack[state] = 1;
}
int c;
void pushEpsilon(int u) {
	if (stateTable[u][STATE] != NOTACCEPT) {
		acceptState = stateTable[u][STATE];
		acceptLength = returnLength;
#if DEBUG
		char tmp[4];
		escape(tmp, c);
		printf("%s in %s accept! length = %d\n",
				tmp, __func__, acceptLength);
#endif
	}
	if (stateTable[u][TYPE] == EPSILON) {
		int i, v;
		for (i = SFIRST; i <= SSECOND; i++) {
			if (stateTable[u][i] != NONEXT) {
				v = stateTable[u][i];
				pushEpsilon(v);
			}
		}
	} else if (!inStack[u]) {
#if 0
			char tmp[4];
			escape(tmp, stateTable[u][SFIRST]);
			printf("%4d - %4s - >\n", u, tmp);
#endif
			pushStack(u);
	}
	
}
void NFA() {
	int i, j;
	extern int c;
	fpos_t currentPos;
	fgetpos(iFile, &currentPos);
	acceptState = NOTACCEPT;
	stackIndex = returnLength = acceptLength = 0;
	currentStack = stateStack[0];
	alternateStack = stateStack[1];
	inClear();
	for (i = initIndex - 1; 0 <= i; i--) {
		if (!inStack[initState[i]]) {
			pushEpsilon(initState[i]);
		}
	}
#if 0
	printf("%d initStates loaded:\n", stackIndex);
	for (i = 0; i < stackIndex; i++) {
		printf("%4d", alternateStack[i]);
	}
	puts("");
#endif
	swapStacks();
	inClear();
	for ( ; stackIndex && ~(returnLength++, c = fgetc(iFile)); ) {
#if DEBUG
		printf("stackIndex = %d\n", stackIndex);
#endif
		//returnLength++;
		j = stackIndex;
		stackIndex = 0;
		for (i = 0; i < j; i++) {
			int u = currentStack[i];
			if (stateTable[u][TYPE] == SYMBOL) {
				if (stateTable[u][SFIRST] == c) {
#if DEBUG
					char _tmp[3], tmp[3];
					escape(_tmp, stateTable[u][SFIRST]);
					escape(tmp, c);
					printf("check %s == %s\n", _tmp, tmp);
#endif
					pushEpsilon(stateTable[u][SSECOND]);
				}
			}
		}
		swapStacks();
		inClear();
	}
	if (c == EOF) {
		isEOF = 1;
	}
	fsetpos(iFile, &currentPos);
#if DEBUG
	char tmp[4];
	//c = fgetc(iFile);
	//fseek(iFile, -1, SEEK_CUR);
	escape(tmp, c);
	printf("'%s' returnLength = %d\n", tmp, returnLength);
#endif
}
